import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import LandingPage from './screen/landingPage';
import { GoogleOAuthProvider } from '@react-oauth/google';

function App() {
  // Making sure we're using the correct environment variable
  // Google Client IDs are typically much longer strings
  const clientId = process.env.REACT_APP_GOOGLE_CLIENT_ID;

  // Log the client ID for debugging purposes
  console.log("Client ID:", clientId);

  // If no client ID is found, provide a helpful message
  if (!clientId || clientId.length < 10) {
    console.error("Invalid Google Client ID. Please check your .env file.");
  }

  return (
    <GoogleOAuthProvider clientId={clientId || "missing-client-id"}>
      <div className="App">
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<LandingPage />} />
          </Routes>
        </BrowserRouter>
      </div>
    </GoogleOAuthProvider>
  );
}

export default App;
